# Return the max of two numbersdef max(num1, num2):    if num1 > num2:        result = num1    else:        result = num2    return resultdef main(num1, num2):    i = num1    j = num2    k = max(i, j)  # Call the max function    print("The larger number of", i, "and", j, "is", k)# Initialize variablesint1 = 8int2 = 3# Run the programmain(int1, int2)   # Call the main function